import WebSocket from 'ws';

const WS_URL = 'ws://127.0.0.1:7701/ws';

async function testContainerMatch() {
  console.log('[TEST] 连接 WS', WS_URL);
  const ws = new WebSocket(WS_URL);

  await new Promise((resolve, reject) => {
    ws.on('open', resolve);
    ws.on('error', reject);
    setTimeout(() => reject(new Error('WS open timeout')), 5000);
  });
  console.log('[TEST] WS 已连接');

  return new Promise((resolve, reject) => {
    const timer = setTimeout(() => reject(new Error('containers:match 超时')), 15000);

    ws.on('message', (data) => {
      try {
        const msg = JSON.parse(data.toString());
        console.log('[TEST] 收到消息:', JSON.stringify(msg, null, 2));
        if (msg.type === 'response' && msg.action === 'containers:match') {
          clearTimeout(timer);
          resolve(msg);
        }
        if (msg.type === 'error') {
          clearTimeout(timer);
          reject(new Error(msg.error || 'WS error'));
        }
      } catch (e) {
        clearTimeout(timer);
        reject(e);
      }
    });

    const payload = {
      type: 'action',
      action: 'containers:match',
      payload: { profile: 'weibo_fresh', url: 'https://weibo.com', maxDepth: 6, maxChildren: 20 }
    };
    console.log('[TEST] 发送:', JSON.stringify(payload, null, 2));
    ws.send(JSON.stringify(payload));
  });
}

testContainerMatch()
  .then((res) => {
    console.log('[TEST] ✅ 容器匹配结果:', JSON.stringify(res, null, 2));
    process.exit(0);
  })
  .catch((err) => {
    console.error('[TEST] ❌ 失败:', err.message);
    process.exit(1);
  });
